  false,\n\t\"url\": null,\n\t\"notes\": \"The landscape plan is a general description
  of refuge lands and provides a broad description of cover types and their locations.
  The identification of these landscapes is used to develop management objectives.
  Documented wildlife surveys show that Rice Lake National Wildlife Refuge has a diverse
  fauna, containing species of special concern in the forest, grassland/brushland
  and wetland cover types. These types have been identified and consolidated into
  landscapes in this document. The Landscape Plan will guide all future habitat management
  plans to emphasize development and/or maintenance of cover types in larger blocks
  to reduce habitat fragmentation. Managing relatively large blocks of bog, forest,
  and grassland/brushland on the refuge will provide habitat for the target species
  which utilize each landscape type. Management of edge-loving species will continue
  where appropriate, but will generally be concentrated between landscapes rather
  than within. Management of landscapes continuing outside refuge boundaries will
  be encouraged through cooperative management agreements with other agencies and
  through the Private Lands program.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
